	(1, 'Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', 'Connaissances minimales en comptabilité requises. Le reste peu être appris sur le tas si vous voulez vous intégrer dans ce groupe. De la rigueur administrative est aussi de mise.', NULL, 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'chat.link/join?v=ad0qqszd33b3avq', 'drive.link/open?f=xiavakel773z1p0pxhyg7k617rqo4tmu90uum02d6ornwl43gg4jkjsah5m9mzy2', 'Travail une fois par mois pour les tâches répétitives', 2, 3, 62, '2020-04-13 07:51:35'),
