	(8, 'Communication', 'Gére toute la communication interne et externe de l\'association. Gère les différents réseaux sociaux.', '', ' sunt. Nam cum in Graeco sermone haec ipsa quondam rerum nomina novarum * * non videbantur, quae nunc consuetudo diuturna trivit; Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Illa argumenta propria videamus, cur omnia sint paria peccata. Ex quo intellegitur idem illud, solum bonum esse, quod honestum sit, idque esse beate vivere: honeste, id est cum virtute, vivere. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat tra', NULL, NULL, 0, 'chat.link/join?v=ufivsnxxldl8huw', 'drive.link/open?f=exhkp6r88wirucxrummvdyc8twn9ihk3mfj94wdugkheqxvv8743wk4rrlc7pgzn09wt', 'Textes et messages envoyés tous les jours. Très actif pour la réfléxion.', 2, 3, 16, '2019-07-24 07:57:46'),
