ibus. Nunc dicam de voluptate, nihil scilicet novi, ea tamen, quae te ipsum probaturum esse confidam. Ut in geometria, prima si dederis, danda sunt omnia. \n\nVide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Sed tamen enitar et, si minus multa mihi occurrent, non fugiam ista popularia. Nam illud quidem adduci vix possum, ut ea, quae senserit ille, tibi non vera videantur. Quaeque de virtutibus dicta sunt, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Nam cum in Graeco sermone haec ipsa quondam rerum nomina novarum * * non videbantur, quae nunc consuetudo diuturna trivit; Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Illa argumenta propria videa', NULL, NULL, 15, 17),
