um Zenonis aiunt esse finem declarantem illud, quod a te dictum est, convenienter naturae vivere. \n\nIn parvis enim saepe, qui nihil eorum cogitant, si quando iis ludentes minamur praecipitaturos alicunde, extimescunt. Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. \n\nQuid, cum volumus nomina eorum, qui quid gesserint, nota nobis esse, parentes, patriam, multa praeterea minime necessaria? Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Atque etiam ad iustitiam colendam, ad tuendas amicitias et reliquas caritates quid natura valeat haec una cognitio potest tradere. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Si in ipso corpore multa voluptati praeponenda sunt', '2020-09-09 09:02:53', 66, 5, 14),
