	(333, 599, ' beate vivere: h', ' Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Sed tamen enitar et, si minus multa mihi occurrent, non fugiam ista popularia. Nam illud quidem adduci vix possum, ut ea, quae senserit ille, tibi non vera videantur. Quaeque de virtutibus dicta sunt, quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Nam cum in Graeco sermone haec ipsa quondam rerum nomina novarum * * non videbantur, quae nunc consuetudo diuturna trivit; Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Illa argumenta propria videamus, cur omnia sint paria peccata. Ex quo intellegitur idem illud, solum bonum esse, quod honestum sit, idque esse beate vivere: honeste, id est cum virtute, vivere. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Fadio Gallo, cuius in testamento scriptum esset se ab eo ', '2019-09-11 01:49:33', 2, 5, 4, 'https://qjtdvq3k/ reliquas caritates quid natura valeat haec una cognitio potest tradere. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Si in ipso corpore multa voluptati praeponenda sunt, ut vires, valitudo, velocitas, pulchritudo, quid tandem in animis censes? Conferam tecum, quam cuique verso rem subicias; Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Itaque ut quisque optime natus institutusque est, esse omn', NULL, 46, 38, 16),
