	(1, 'josette27', 'JRD', 'Josette', 'Richard', 'chat.link/user?t=hcoqju3rjdxjs', 'josette.richard@assoc.ch', '7989075342', 'Dans le milieu associatif, depuis 10 ans déjà, je suis à dans assoc depuis 2015 et j\'aide plusieurs heures par semaines. La partie contact médias m\'intéresse beaucoup. Je suis photorgaphe de métier, mais aussi céramiste et je cultive un petit potager...', '$2y$10$FAhmbUIcdL1.0VUn4cvOuu1wLiEoU5IQXlzIr80z6hj66HsGd1HQ2', '2019-10-27 16:20:01', 1, 'Actuellement en vacances, je reviendrai le 15. En cas d\'urgence laissez moi un SMS et je vous rappelerai en soirée.', 4, 1, '2019-12-26 06:51:02'),
	(2, 'vincent28', 'VRT', 'Vincent', 'Rigot', '', 'vincent.rigot@assoc.ch', '6717879650', 'Je suis passionné de litérrature, et la presse me questionne beaucoup aujourd\'hui. Les sujets polémiques ne sont pas les plus intéressants, mais ceux dont on ne parle jamais regorgent d\'informations passionnantes et de récits fabuleux.', '$2y$10$nFXtYOQZJA8sNRkIBKG4keRH.A3Izp9TtMOmdhkj0Nh2FAkl/FMuS', '2019-03-23 15:45:58', 0, 'Actuellement en travail intense sur la rédaction d\'un document contenant des réflexions autour du militantisme à l\'époque des Romains!', 3, 1, '2019-09-19 12:53:29'),
	(3, 'megane32', 'MBN', 'Mégane', 'Blan', 'chat.link/user?t=k8s81d12gvrkb', 'megane.blan@assoc.ch', '7721358895', 'Je suis une passionée de festival. J\'en vais 4 fois par mois. Je trouvais le festival de Assoc vraiment génial alors j\'ai voulu venir ajouter mon grain de sel et aider pour la communication. Je suis fan de musique et je joue du violon. Je consacre 5h par semaine à Assoc la plupart de l\'année, et tout mon temps quand il y a le festival...', '$2y$10$jCVLoIBNjQi/4ebMwUESuOaej./yMDXcHZH8XHzgqXVFd1DrpSbuS', '2020-04-10 03:53:47', 0, 'Encore quelques jours de repos avant de commencer à travailler à fond pour le festival. J\'aimerai que cette édition soit exceptionnelle!', 1, 1, '2020-06-03 15:03:20'),
